import React from 'react';
import PopulateCharacters from './PopulateCharacters';

function ShowUserCharacters(props){
    // console.log(props)
    // console.log(characters)
    const { characters } = props.currentUser

    return(
        <div className="UserCharacters">
            <PopulateCharacters currentUser={characters} />
        </div>
    )
}

export default ShowUserCharacters;

